aWLIOfferedIndividualLifeCoverageWithCas.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1033\deflangfe1033{\fonttbl{\f0\fswiss\fprq2\fcharset0 Microsoft Sans Serif;}{\f1\fswiss\fprq2\fcharset0 Arial;}}
{\colortbl ;\red128\green0\blue0;}
\viewkind4\uc1\pard\lang2057\f0\fs16 This type of policy offers you more flexibility than \cf1\b whole life\b0  \cf0 insurance. You may be able to increase the death benefit, if you pass a medical examination. The savings vehicle (called a cash value account) generally earns a money market rate of interest. After money has accumulated in your account, you will also have the option of altering your premium payments - providing there is enough money in your account to cover the costs. This can be a useful feature if your economic situation has suddenly changed. However, you would need to keep in mind that if you stop or reduce your premiums and the saving accumulation gets used up, the policy might lapse and your life insurance coverage will end. You should check with your agent before deciding not to make premium payments for extended periods because you might not have enough cash value to pay the monthly charges to prevent a policy lapse.\f1\fs20\par
}

aWLIOfferedLifeOrDisabilityCoverage.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1033{\fonttbl{\f0\fnil MS Sans Serif;}{\f1\fnil\fcharset0 MS Sans Serif;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\cf1\f0\fs16 As an alternative to purchasing an individual Universal Life certificate for a dependent child, an insured contractor or his or her spouse can elect to provide up to $10,000 of Term Life coverage for each child.  He or she does this by attaching a Term Rider to the insured contractor's or spouse's Universal Life certificate.  This is an affordable way to protect a child during a contractor\f1\u65533?s working years.\f0\par
}

aWLICashValue_MixedProduct.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1033\deflangfe1033{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}}
\viewkind4\uc1\pard\lang2057\f0\fs20 Universal life insurance (often shortened to UL) is a type of permanent life insurance based on a cash value. That is, the policy is established with the insurer where premium payments above the cost of insurance are credited to the cash value of the policy. The cash value is credited each month with interest, and the policy is debited each month by a cost of insurance (COI) charge, as well as any other policy charges and fees which are drawn from the cash value if no premium payment is made that month. The interest credited to the account is determined by the insurer; sometimes it is pegged to a financial index such as a bond or other interest rate index.\par
}
